import React, { useEffect } from "react";
import axios from "axios";
import { useState } from "react/cjs/react.production.min";

const Episodes = () => {
  const [episode, setEpisode] = useState([]);

  const fetchData = () => {
    return axios
      .get("https://api.sampleapis.com/futurama/episodes")
      .then(({ data }) => {
        return data;
      })
      .catch((error) => {
        return error;
      });
  };

  useEffect(() => {
    fetchData().then((data) => {
      setEpisode(data);
    });
  }, []);

  return <div>{episode.map((title) => episode.title)}</div>;
};

export default Episodes;

// https://api.sampleapis.com/futurama/episodes
